import React from 'react';
import './Footer.css';
import Logo from '../../Assets/Images/TRNN.png';
import Fb from '../../Assets/Images/fb.png';
import Tiktok from '../../Assets/Images/tiktok.png';
import Twiter from '../../Assets/Images/twitter.png';
import Instagram from '../../Assets/Images/instagram.png';
import Email from '../../Assets/Images/email.png';
import Phone from '../../Assets/Images/phon.png';

const Footer = () => {
  return (
    <div className='footerstyle'>
      <div className='footLayouter'>
        <div className='leftSide'>
          <img src={Logo} alt='logo.png'/>
          <div className='icons'>
          <a href='www.Tiktok.com'><img src={Tiktok} alt='logo.png'/></a>
          <a href='www.facebook.com'><img src={Fb} alt='logo.png'/></a>
          <a href='www.x.com'><img src={Twiter} alt='logo.png'/></a>
          <a href='www.instagram.com'><img src={Instagram} alt='logo.png'/></a>
          </div>
        </div>
        <div className='rightSide'>
          <div className='quicklink'>
            <ul>
              <h4>Quick Links</h4>
              <li><button>About Us</button></li>
              <li><button>Services</button></li>
              <li><button>Contact Us</button></li>
              <li><button>Privacy Policy</button></li>
            </ul>
          </div>
          <div className='cntc'>
            <h4>Contact Us</h4>
            <a href='mailto:abc@gmail.com' style={li}><img src={Phone} alt='email.png'/><p>abc@gmail.com</p></a>
            <img src={Email} alt='email.png'/>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Footer
